import React, {Component} from 'react';
import {Link} from "react-router-dom";
import './Home.css';

class Home extends Component{

  componentDidMount(){
    this.changeStyle();
  }

  changeStyle = () =>{
    this.refs['box'].style.opacity = "1";
  }
  render(){
    return (
      <div className="homeWrapper">
        <div id="box">
          <Link to="/parks" className="links">Explore More</Link>
        </div>
      </div>
    );
  }
}

export default Home;
